        imgbox.style.cursor = ''pointer'';
        imgbox.style.fontsize = "0";
        imgbox.style.left = "0";
        imgbox.style.padding = "" + getElementTop(obj) - 50 + " 0 0 25%";

        var img = document.createElement("img");
        img.src = obj.src;
        img.style.height = "800px";
        img.style.width = "800px";

        if (img.addEventListener) {
            img.addEventListener(''click'', Out, false);
        } else {
            img.attachEvent(''click'', Out);
        }

        if (imgframe.addEventListener) {
            imgframe.addEventListener(''click'', Out, false);
        } else {
            imgframe.attachEvent(''click'', Out);
        }

        imgbox.innerHTML = '''';
        imgbox.appendChild(img);
        document.getElementById("ps_prev").style.visibility = ''hidden'';
        document.getElementById("ps_next").style.visibility = ''hidden'';

    }

    function Out(obj) {

        document.getElementById("ps_prev").style.visibility = ''visible'';
        document.getElementById("ps_next").style.visibility = ''visible'';
        document.getElementById("imgbox").style.visibility = ''hidden'';
        document.getElementById("imgframe").style.visibility = ''hidden'';


